import '../App.css';
import '../Styles/Clock.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import { Button } from 'react-native';

function CountDown() {
  return (
    <div>
      <div className="clock">
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center"
          }}
        >
          <Button
            title="Press me"

          />
          <div className="hour">13</div>
        </div>
        <div className="colon">:</div>
        <div className="minute">55</div>
        <div className="colon">:</div>
        <div className="minute">20</div>
      </div>
    </div>
  );
}

export default CountDown;
